import React, { Component } from "react";

class Posts extends Component {
  state = { data: {} };
  componentDidMount() {
    this.getData();
  }

  getData = async () => {
    const response = await fetch("http://localhost:3001/posts");
    const posts = await response.json();
    console.log(posts);
  };

  render() {
    return (
      <div>
        <h1>Posts</h1>
      </div>
    );
  }
}

export default Posts;
